import React, { Component } from 'react';
import Banner from './components/Banner'

import './App.css';

class App extends Component {
	state = {
		banner_items: [
			{
				id: 0,
				page_title: "Blog"
			},
			{
				id: 1,
				page_title: "Resume"
			},
			{
				id: 2,
				page_title: "Games"
			},
			{
				id: 3,
				page_title: "Projects"
			},
			{
				id: 4,
				page_title: "More"
			}
		]
	}


	render() {
		console.log(this.state.banner_items);
		return (
		  <div className="App">
		  	<Banner banner_items={this.state.banner_items}/>
		    <h1>Nigel's Website</h1>
		  </div>
		);
		}
	}

export default App;
